import './MoviesCard.css';
import poster from "../../../images/pic__movie.jpg";

function MoviesCard() {
  return (
    <article className="movies-card">
      <h3 className="movies-card_title">33 слова о дизайне</h3>
      <p className="movies-card__duration">1ч 42м</p>
      <button className="movies-card__like"></button>
      <img src="" alt="" className="movies-card__image" />
    </article>
  )
};

export default MoviesCard;
